const items = $input.all();  // Fetch the input from the previous node

// Regex to extract URLs
const urlPattern = /https?:\/\/[^\s"<>]+/g;

// Function to extract listing ID from URL
const extractListingId = (url) => {
  const match = url.match(/\/(\d+)\.html$/);
  return match ? match[1] : null;
}

// Function to extract the city from the subject field
const extractCityFromSubject = (email_subject) => {
  const cityPattern = /cars\+trucks \(([^)]+)\)/;
  const match = email_subject.match(cityPattern);
  return match ? match[1] : null;
}

// Function to extract and format the date and time from the x-received field
const extractDateTimeFromXReceived = (email_date_received) => {
  const dateTimePattern = /(\w{3}, \d{2} \w{3} \d{4}) (\d{2}:\d{2}:\d{2})/;
  const match = email_date_received.match(dateTimePattern);

  if (match) {
    const originalDate = new Date(`${match[1]} ${match[2]} GMT-0700`); // Convert to PDT

    // Format the date as yyyy.mm.dd
    const formattedDate = originalDate.getFullYear() + '.' + 
                          String(originalDate.getMonth() + 1).padStart(2, '0') + '.' + 
                          String(originalDate.getDate()).padStart(2, '0');

    // Extract and format the time and append "PDT"
    const formattedTime = `${match[2]} PDT`;

    return `${formattedDate} || ${formattedTime}`;
  }
  return null;
}

// Function to filter and process the data
const processData = (items) => {
  let output = [];

  items.forEach(item => {
    const { id_email, email_subject, email_body, headers } = item.json;

    // Extract the city from the subject field
    const city = extractCityFromSubject(email_subject);

    // Extract URLs from the body
    const urls = email_body.match(urlPattern) || [];

    // Filter unwanted URLs and remove duplicates
    const validUrls = Array.from(new Set(
      urls.filter(url => 
        !url.includes("/search/") &&
        !url.includes("/savesearch") &&
        !url.includes("/store/apps") &&
        !url.includes("/us/app")
      )
    ));

    // Extract the date and time from x-received
  //  const email_date_received = headers["x-received"];
   // const alert_email_received = extractDateTimeFromXReceived(email_date_received);

    // For each valid URL, create a new object with the additional data and listing ID
    validUrls.forEach(url => {
      const listing_id = extractListingId(url);  // Extract the listing ID
      output.push({
        id_email,
        city,  // The city extracted from the subject
        email_subject,
      //  email_date_received,  // Replaces x-received
        listing_url: url,  // Renamed from extracted_url to listing_url
        listing_id  // Add listing ID to the output
      });
    });
  });

  return output;
}

// Process the input data and return the result
const result = processData(items);

// Return the result for the next node
return result;
